import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { HeaderComponent } from './header/header.component';
import { RecipesComponent } from './recipes/recipes.component';
import { RecipreListComponent } from './recipes/recipre-list/recipre-list.component';
import { RecipreDetailComponent } from './recipes/recipre-detail/recipre-detail.component';
import { ShoppingComponent } from './shopping/shopping.component';
import { ShoppingListComponent } from './shopping/shopping-list/shopping-list.component';
import { ShoppingEditComponent } from './shopping/shopping-edit/shopping-edit.component';
import { ShoppingAddComponent } from './shopping/shopping-add/shopping-add.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    RecipesComponent,
    RecipreListComponent,
    RecipreDetailComponent,
    ShoppingComponent,
    ShoppingListComponent,
    ShoppingEditComponent,
    ShoppingAddComponent,
  ],
  imports: [
    BrowserModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
